<template>
  <div>
    <div class="back">
      <img
        class="logtitle"
        src="data:image/png;base64,"
        alt
      />
      <!-- <img src="../../assets/back.png" alt> -->
    </div>

    <div class="center">
      <img class="logtitle" src="../../assets/logotitle.png" alt />
    </div>

    <div class="centerlog">
      <div style="width:80%;margin:0 auto;">
        <h3 class="title">供应商账号登录</h3>
        <div class="error" v-if="errflag">
          <img
            src="data:image/png;base64,"
            alt
          />
          <span>{{error}}</span>
        </div>
        <div class="account">
          <input v-model="username" placeholder="请输入供应商账号" type="text" />
        </div>
        <div class="psw">
          <input v-model="psw" placeholder="请输入密码" type="password" />
        </div>
        <div class="forget">
          <input id="color-input-red" type="checkbox" @click="ischecked($event)" />
          <label for="color-input-red"></label> 记住账号
          <span style="float:right;" @mouseenter="onMouseOver" @mouseleave="onMouseout">忘记密码?</span>
          <el-tag type="warning" v-show="seen">请联系婴众心选管理员</el-tag>
        </div>
        <!-- <div v-show="seen">请联系婴众心选管理员</div> -->
        <div class="reg">
          <button v-on:click="submit">登&emsp; 录</button>
        </div>
      </div>
    </div>
    <div class="bottom">
      <span>©2019 婴众趣购版权所有</span>
    </div>
  </div>
