<script> 
import axios from 'axios'
let qs = require("qs");
export default {
    data(){
      return{
        errflag:false,
        error:'',
        mainUrl:this.domain.testUrl,
        // mainUrl:"https://dev.qutego.com/",
        seen:false,
        name:null,
        pssw:null,
        username:'',
        psw:'',
      }
    },
    mounted:function(){
      var user = sessionStorage.getItem("username")
      var ps = sessionStorage.getItem("psw")
      this.username = user
      this.psw = ps
    },
    methods:{
      ischecked(e){
        console.log(e)
        var checked = e.target.checked;
        if(checked){
          sessionStorage.setItem("username",this.username)
          sessionStorage.setItem("psw",this.psw)
        }
      },
      // 提交表单
      submit(){
        var that = this;
        this.name = this.username;
        this.pssw = this.psw;
        if(this.name===''){
          alert('请输入用户名')
          return;
        }
        if(this.pssw === ''){
          alert('请输入密码')
          return;
        }
        var params = {username :this.name,pwd:this.pssw};      
        this.axios.post(this.mainUrl+'supplier.php?c=index&a=login',qs.stringify(params)
          ).then(function(response){
          console.log(response)
          let {err_code,err_msg}=response.data
          var name = err_msg.name;
          sessionStorage.setItem('id',err_msg.id)
          sessionStorage.setItem('name',name)
          if(err_code==0){
            that.$router.push({
              path:'/ordersys',
              query:{id:err_msg.id,name:err_msg.name}
            }) 
          }else{
            that.errflag = true;
            that.error = err_msg;
            // alert(err_msg)
          }
        })
      },
      // gotoorder(){
      //   this.$router.push({
      //     name:'ordersys',
      //     params:{name:err_msg.name,id:err_msg.id}
      //   })
      // },
      // 鼠标移入移除
      onMouseOver(){
        this.seen = true
      },
      onMouseout(){
        this.seen = false
      }
    }
}
</script>